import socketio from 'socket.io-client';

export const BASE_URL = 'https://serendy-server.herokuapp.com';
export const LOGO_URL = '/images/start_logo.png';
export const TEXTLOGO_URL = '/images/serendy_text.png';

export type DisplayType = 'block' | 'none';
export type VisibilityType = 'visible' | 'hidden';

export const socket = socketio('http://localhost:8000');
